                <input type="password" name="registerUsername" id="registerUsername" value={passwordRegisterInput} onChange={(e) => {setPasswordRegisterInput(e.target.value)}}/>
                <input type="submit" value="Register" />
            </form>
        </section>
    );
}

export default LoginRegister;
